if (!function_exists('get_field_by_id')) {
	/**
	 * Ly thng tin vi trng ca bng no 
	 * @param string $id
	 * @param string $field
	 * @param string $table
	 * @return string
	 */
	function get_field_by_id($id = '', $field = '', $table = '')
	{
		if (!$id || !$field || !$table) {
			return '';
		}
		$ci = &get_instance();
		if (is_array($id)) {
			$data = '';
			foreach ($id as $key => $value) {

				$ci->db->where('id', $value);
				//$ci->db->where('dt_active', 1);
				$ci->db->select($field);
				$query = $ci->db->get($table);
				if ($query->num_rows() > 0) {
					$data .= ($key == 0 ? '' : ', ') . $query->row()->$field;
				} else {
					$data .= ($key == 0 ? '' : ', ') . '';
				}
			}
			return $data;
		} else {

			$ci->db->where('id', $id);
			//  $ci->db->where('dt_active', 1);
			$ci->db->select($field);
			$query = $ci->db->get($table);
			if ($query->num_rows() > 0) {
				return $query->row()->$field;
			} else {
				return '';
			}
		}
	}
}

/**
 * Hm get_data2
 *
 * Ly gi tr ca mt field hoc tt c field t bng d liu
 *
 * @param table name
 * @param   [, where condition = '']
 * @param   [, field = '']  :
 * @param   [, r_type = ''] :   data type is returned     :  '' - array; 1 - 1 element; 0 - json
 * @param   [, start = '']  :   0
 * @param   [, limit = '']  :   10
 * @param   [, order = '']  :   'title desc, name asc'
 * @return  field value if (field='field name')
 * @return  data array if (field='*')
 */
if (!function_exists('get_data2')) {
	function get_data2($table, $where = array(), $field = '', $r_type = 'json', $start = '', $limit = '', $order = '')
	{
		$ci = &get_instance();
		if ($ci->db->table_exists($table)) {
			$ci->db->query('SET NAMES "utf8mb4"');
			if ($field) $ci->db->select($field);
			if ($where != "") $ci->db->where($where);
			if ($order != "") $ci->db->order_by($order);
			if (is_numeric($limit) && is_numeric($start)) $ci->db->limit($limit, $start);
			$q = $ci->db->get($table);
			if ($q->num_rows() > 0) {
				if ($r_type == '1') {
					$data = $q->row_array();                        // one row
					$field_arr = explode(',', $field);
					if (count($field_arr) > 1) {
						return $data;
					} else {
						return $data[$field];                       // one value if only one field; otherwise, false;
					}
				} else if ($r_type == 'json') {
					return json_encode($q->result_array());         // json
				} else {
					return $q->result_array();                      // array
				}
			} else {
				return false;
			}
		} else {
			return false;
		}
	}
}

/**
 * Hm get_data
 *
 * Ly gi tr ca mt field hoc tt c field t bng d liu
 *
 * @access  public
 * @param table name
 * @param   [, where condition = '']
 * @param   [, field = *]
 * @param   [, start = '']
 * @param   [, limit = '']
 * @param   [, order = '']
 * @return  field value if (field='field name')
 * @return  data array if (field='*')
 */
if (!function_exists('get_data')) {
	function get_data($table, $where = '', $field = '*', $start = '', $limit = '', $order = '')
	{

		$ci = &get_instance();
		//$ci->load->database();
		if ($ci->db->table_exists($table)) {
			$ci->db->query('SET NAMES "utf8mb4"');
			if (substr($field, 0, 1) != '*') $ci->db->select($field);
			if ($where != "") $ci->db->where($where);
			if ($order != "") $ci->db->order_by($order);
			if (is_numeric($start) && is_numeric($start)) $ci->db->limit($limit, $start);
			$q = $ci->db->get($table);
			if ($q->num_rows() > 0) {
				if ($field == '**') {
					return $q->result_array();
				} else {
					$data = $q->row_array();
					if ($field != '*') return $data[$field];
					else return $data;
				}
			} else {
				return false;
			}
		} else {
			return false;
		}
	}
}

