function datetotime($time)
{
	$date = strtotime(str_replace("/", "-", $time));
	return strtotime(date('Y-m-d', $date));
}
function timetodate($data)
{
	return date('d/m/Y', $data);
}
/**
 * Hm getQuarterByMonth
 *
 * Ly Qu ca thng
 *
 * @access  public
 */
function getQuarterByMonth($monthNumber)
{
	return floor(($monthNumber - 1) / 3) + 1;
}

/**
 * @return [date]       : new date (Y-m-d)
 * @var [num_of_day]    : number of day need to plus or minus
 * @var [sign_]         : TRUE is plus; FALSE is minus
 * @var [date_] Y-m-d
 */
if (!function_exists('calculate_date')) {
	function calculate_date($date_, $num_of_day, $sign_ = TRUE)
	{
		if ($sign_) {
			return date('Y-m-d', strtotime('+' . $num_of_day . ' day', strtotime($date_)));
		} else {
			return date('Y-m-d', strtotime('-' . $num_of_day . ' day', strtotime($date_)));
		}
	}
}

if (!function_exists('format_read_time')) {
	function format_real_time(&$time, $field)
	{
		if (is_array($time) && count($time)) {
			$datetime1 = new DateTime(date(TIME_SQL));
			foreach ($time as &$nof) {
				$datetime2 = new DateTime($nof[$field]);
				$interval = $datetime2->diff($datetime1);
				$str = '';
				$str .= $interval->format('%ad %hh %imin %S\'');
				$str .= ' before, at ' . date('d/m/Y', strtotime($nof[$field]));
				$ch_str = explode(' ', $str);
				if (isset($ch_str[0]) && $ch_str[0] == '0d') unset($ch_str[0]);
				if (isset($ch_str[1]) && $ch_str[1] == '0h') unset($ch_str[1]);
				if (isset($ch_str[2]) && $ch_str[2] == '0min') unset($ch_str[2]);
				$nof[$field] = implode(' ', $ch_str);
			}
		}
	}
}


